addEventListener("keydown", function(e){
	if (ukui) {
		for (let i = 0; i < unikbui.queue.length; i++) {
			const element = unikbui.queue[i];
			UKeys.setKeybind(UKeysObj.keyids[element], LWJGLKeycodes.indexOf(e.code))
		}
		unikbui.queue = []
		UKrenderui()	
	}
})

//actual api code

function UKrenderui() {

	const cBindArea = document.getElementById("uktable")
	cBindArea.innerHTML = "<tr><th>Title</th><th>Keybind</th></tr>"
	for (let i = 0; i < UKeysObj.keyids.length; i++) {
		let tr = document.createElement("tr")
		
		let id = document.createElement("td")
		id.innerHTML = UKeysObj.keyids[i];
		tr.appendChild(id)

		let bind = document.createElement("td")
		let bindButton = document.createElement("button")
		let reset = document.createElement("button")
		bindButton.innerHTML = (UKeysObj.keyvals[i] !== "NONE") ? backToLWJGL[UKeysObj.keyvals[i]] : 'NONE';
		bindButton.setAttribute("id", "kb" + i)
		bindButton.setAttribute("class", "mcButton mcKeybindButton")
		bindButton.setAttribute("onclick", "unikbui.queue.push(" + i + ");document.getElementById('kb" + i + "').innerHTML = '[PRESS]'")

		reset.setAttribute("class", "mcButton mcResetButton")
		reset.innerHTML = "CLEAR"
		reset.setAttribute("onclick", "UKeys.setKeybind('" + UKeysObj.keyids[i] + "');UKrenderui()")
		
		if (UKeysObj.keyvals[i] === "NONE") {
			reset.setAttribute("disabled", "true")	
		}

		bind.appendChild(bindButton)
		bind.innerHTML = bind.innerHTML + "&nbsp&nbsp"
		bind.appendChild(reset)
		tr.appendChild(bind)
		cBindArea.appendChild(tr)

		

	}
}

const UKeys = {
	addKeybind:function(_title, _function, _defaultBind="NONE") {
		if (UKeysObj.keyids.indexOf(_title) === -1) {
			UKeysObj.keyids.push(_title)
			UKeysObj.keyvals.push(_defaultBind)
			UKeysObj.functions.push(_function)				
		}
	},
	removeKeybind:function(_title) {
		let index = UKeysObj.keyids.indexOf(_title)
		removeFromArray(UKeysObj.keyids, index)
		removeFromArray(UKeysObj.keyvals, index)
		removeFromArray(UKeysObj.functions, index)
	},
	setKeybind:function(_title, _bind="NONE") {
		let index = UKeysObj.keyids.indexOf(_title)
		UKeysObj.keyvals[index] = _bind
	}
}

ModAPI.addEventListener("key", function(e){
	for (let i = 0; i < UKeysObj.keyids.length; i++) {
		if (e.key === UKeysObj.keyvals[i]) {
			eval(UKeysObj.functions[i])
		}
	}
})